Владимир Путин фактически озвучил основные цели силовой операции:


🔺Луганская и Донецкая область будут возвращены в состав ЛДНР по границам 2014 года, но для этого нужно время;

🔺Киев должен признать Крым;

🔺Неприем Украины в НАТО;

🔺Киевские власти должны отказаться от вступления в НАТО;

🔺Запад должен прекратить поставлять оружие на Украину.

Президент Киргизии Садыр Жапаров сегодня присвоил очередные воинские звания ряду руководителей силовых структур:
⠀
🇰🇬министру внутренних дел Улану Ниязбекову присвоено звание генерал-лейтенанта милиции;
🇰🇬министру обороны Бактыбеку Бекболотову присвоено воинское звание генерал-лейтенанта;
🇰🇬замминистра внутренних дел Нурбеку Абдиеву присвоено звание генерал-майора милиции;
🇰🇬замминистра внутренних дел Октябрю Урмамбетову присвоено звание генерал-майора милиции;
🇰🇬замминистра обороны Акылбеку Ибраеву присвоено воинское звание генерал-майора;
🇰🇬зампредседателя — начальнику Девятой службы ГКНБ Жумгалбеку Шабданбекову присвоено воинское звание генерал-майора;
🇰🇬командиру войсковой части № 01003 Минобороны Руслану Мукамбетову присвоено воинское звание генерал-майора.
⠀
Садыр Жапаров выразил уверенность в том, что отмеченные сегодня руководители силовых структур продолжат достойно выполнять возложенные на них задачи. Он пожелал им дальнейших успехов в службе, крепкого здоровья и благополучия.
